import React, { useEffect } from "react";
import WebFont from "webfontloader";

export default function Header() {
  useEffect(() => {
    WebFont.load({
      google: {
        families: ["Droid Sans", "Chilanka"],
      },
    });
  }, []);

  return (
    <>

      <h1 className="header text-white text-center">The Writer's Cave</h1>

      <a className="font-loader text-white text-right"> My writings</a>
    </>
  );
}
